import React from 'react';
import classes from './dialog.module.css';

const Dialog = (props)=>
{
    return(
        <div>
            <div className={classes.dialogs}>
                <div className={userName}>

                </div>
            </div>
            <div className={classes.pole}>
                
            </div>
        </div>
    );
}
export default Dialog;
